This method has the same behavior regardless of the
[`MatchKind`](enum.MatchKind.html)
of this automaton.

`haystack` may be any type that is cheaply convertible to a `&[u8]`.
This includes, but is not limited to, `String`, `&str`, `Vec<u8>`, and
`&[u8]` itself.

