Or alternatively, with turbofish:

```
use aho_corasick::AhoCorasickBuilder;

# fn example() -> Result<(), ::aho_corasick::Error> {
let patterns = &["foo", "bar", "baz"];
let ac = AhoCorasickBuilder::new()
    .build_with_size::<u8, _, _>(patterns)?;
